INSERT INTO `item` VALUES (213, 13, 0, 3, 'Bùa Trí Tuệ', '', 'Tiềm năng và sức mạnh của bạn sẽ nhận được gấp đôi trong 1 khoảng thời gian, kể từ lúc mua', 0, 1403, -1, 'false', 0, 0, 0, 0, 1, '[{\"id\": 73,\"param\": 0}]');
INSERT INTO `item` VALUES (214, 13, 0, 3, 'Bùa Mạnh Mẽ', '', 'Cú đấm của bạn sẽ mạnh hơn. Tăng 150% sức đánh hiện có khi bạn đánh Quái trong 1 khoảng thời gian, kể từ lúc mua', 0, 1404, -1, 'false', 0, 0, 0, 0, 1, '[{\"id\": 66 ,\"param\": 0}]');
INSERT INTO `item` VALUES (215, 13, 0, 3, 'Bùa Da Trâu', '', 'Tăng sức chịu đòn cho bạn. Khi bị quái đánh, máu sẽ mất ít hơn, chỉ còn 50% bình thường. Có tác dụng trong 1 khoảng thời gian kể từ lúc mua', 0, 1405, -1, 'false', 0, 0, 0, 0, 1, '[{\"id\": 66 ,\"param\": 0}]');
INSERT INTO `item` VALUES (216, 13, 0, 3, 'Bùa Oai Hùng', '', 'Bạn sẽ oai vệ hơn. Quái Thủ Lĩnh sẽ sợ bạn và đánh bạn yếu đi, y như con quái thường. Có tác dụng trong 1 khoảng thời gian kể từ lúc mua', 0, 1406, -1, 'false', 0, 0, 0, 0, 1, '[{\"id\": 73,\"param\": 0}]');
INSERT INTO `item` VALUES (217, 13, 0, 3, 'Bùa Bất Tử', '', 'Bạn sẽ không bao giờ bị quái đánh chết. Thay vào đó chỉ còn 1 máu. Tuy nhiên bạn phải bơm máu mới có thể đánh lại. Có tác dụng trong 1 khoảng thời gian kể từ lúc mua.', 0, 1407, -1, 'false', 0, 0, 0, 0, 1, '[{\"id\": 73,\"param\": 0}]');
INSERT INTO `item` VALUES (218, 13, 0, 3, 'Bùa Dẻo Dai', '', 'Thể lực của bạn sẽ không bao giờ giảm khi bùa này có tác dụng. Có tác dụng trong 1 khoảng thời gian, kể từ lúc mua', 0, 1408, -1, 'false', 0, 0, 0, 0, 1, '[{\"id\": 73,\"param\": 0}]');
INSERT INTO `item` VALUES (219, 13, 0, 3, 'Bùa Thu Hút', '', 'Vật phẩm bạn đánh văng ra nếu là của bạn, nó sẽ tự bay vào người. Bạn sẽ không phải nhặt bằng tay. Có tác dụng trong 1 khoảng thời gian, kể từ lúc mua', 0, 1409, -1, 'false', 0, 0, 0, 0, 1, '[{\"id\": 73,\"param\": 0}]');
