INSERT INTO `tasktemplate` VALUES (0, 'Nhiệm vụ đầu tiên', 'Chi tiết nhiệm vụ', '[\"Hãy di chuyển nhân vật\",\"Đi đến Nhà Broly\", \"Nói chuyện với ông Paragus\",\"Mở rương đồ\",\"Thu hoạch đậu thần\",\"Báo cáo với ông Paragus\",\"\"]', '[-1,-1,-1,-1,-1,-1,-1]', '[\"\",\"\",\"\",\"#Rương đồ đằng kia,  đi đến gần và click đôi vào rương để mở \\nChọn lấy Rađa để sử dụng\",\"Bạn có thể thu hoạch đậu thần ở cây đậu đằng kia\",\"Nào, bây giờ bạn có thể gặp ông Paragus để báo cáo rồi!\",\"\"]');
INSERT INTO `tasktemplate` VALUES (1, 'Nhiệm vụ tập luyện', 'Mộc nhân được đặt nhiều tại Làng Moori, ngay trước nhà ông Moori\r\nHãy đánh ngã 5 mộc nhân, sau đó quay về nhà báo cáo với ông Moori\r\nĐể đánh, hãy click đôi vào đối tượng\r\nThưởng 500 sức mạnh\r\nThưởng 500 tiềm năng', '[\"Đánh ngã 5 mộc nhân\", \"Báo cáo với ông Moori\"]', '[5, -1]', '[\"\", \"Chúc mừng bạn đã hoàn thành nhiệm vụ. Nào, bây giờ bạn có thể gặp ông Moori để báo cáo rồi!\"]');
INSERT INTO `tasktemplate` VALUES (2, 'Nhiệm vụ thử thách', 'Khủng long xuất hiện tại Đồi nấm tím.\r\nHãy đánh bại khủng long, thu thập đủ 10 đùi gà sau đó quay về nhà báo cáo với ông Moori.\r\nĐể đánh, hãy click đôi vào đối tượng.\r\nThưởng 1 k sức mạnh\r\nThưởng 1 k tiềm năng', '[\"Thu thập 10 đùi gà\", \"Báo cáo với ông Moori\"]', '[10,-1]', '[\"#Để sử dụng bản đồ, hãy mở menu, mục Nhiệm vụ, chọn Bản Đồ\\nVị trí đang chớp sáng là nơi bạn làm nhiệm vụ, hãy tìm đường đến đó\", \"Chúc mừng bạn đã hoàn thành nhiệm vụ. Nào, bây giờ bạn có thể gặp ông Moori để báo cáo rồi!\"]');
INSERT INTO `tasktemplate` VALUES (3, 'Nhiệm vụ sao băng', 'Dùng tiềm năng con có để nâng cấp HP, KI hoặc Sức đánh\r\nKiểm tra khu vực sao băng rơi tại Vách núi Moori\r\nThưởng 2 k sức mạnh\r\nThưởng 2 k tiềm năng', '[\"Dùng tiềm năng\", \"Tìm kiếm sao băng\",\" Báo cáo với ông Moori\"]', '[-1, -1,-1]', '[\"#Chúc mừng bạn vừa nhận được 1.000 tiềm năng\\nMở menu chọn mục kỹ năng, dùng điểm tiềm năng cộng vào HP, KI hoặc Sức đánh\", \"\", \"Hãy bế cậu bé về nhà!\"]');
INSERT INTO `tasktemplate` VALUES (4, 'Nhiệm vụ', 'Khủng long mẹ sống tại Trái Đất\r\nLợn lòi mẹ sống tại Namếc\r\nQuỷ đất mẹ sống tại Xayda\r\nDùng tàu vũ trụ để di chuyển sang hành tinh khác\r\nThưởng 4 k sức mạnh\r\nThưởng 4 k tiềm năng', '[\"Đánh 3 con khủng long mẹ\", \"Đánh 3 con lợn lòi mẹ\", \"Đánh 3 con quỷ đất mẹ\", \"Báo cáo với ông Gôhan\"]', '[3, 3, 3, -1]', '[\"Bạn vừa nhận được bản đồ của hành tinh tiếp theo\", \"#Tốt lắm, bây giờ hãy đến hành tinh tiếp theo nào\\nĐể di chuyển đến hành tinh khác, bạn hãy đến Trạm Phi Thuyền, gặp Dr. Brief\\nNhanh lên, mọi người đang cần sự giúp đỡ của bạn đấy\", \"Mau đến hành tinh tiếp theo nào. Nhanh lên, mọi người đang cần sự giúp đỡ của bạn đấy\", \"Xong việc rồi, về báo cáo với ông Gôhan nào!\"]');
INSERT INTO `tasktemplate` VALUES (5, 'Nhiệm vụ', 'Khủng long mẹ sống tại Trái Đất\r\nLợn lòi mẹ sống tại Namếc\r\nQuỷ đất mẹ sống tại Xayda\r\nDùng tàu vũ trụ để di chuyển sang hành tinh khác\r\nThưởng 4 k sức mạnh\r\nThưởng 4 k tiềm năng', '[\"Đánh 3 con lợn lòi mẹ\", \"Đánh 3 con khủng long mẹ\", \"Đánh 3 con quỷ đất mẹ\", \"Báo cáo với ông Moori\"]', '[3, 3, 3, -1]', '[\"Bạn vừa nhận được bản đồ của hành tinh tiếp theo\", \"#Tốt lắm, bây giờ hãy đến hành tinh tiếp theo nào\\nĐể di chuyển đến hành tinh khác, bạn hãy đến Trạm Phi Thuyền, gặp Cargo\\nNhanh lên, mọi người đang cần sự giúp đỡ của bạn đấy\", \"Mau đến hành tinh tiếp theo nào. Nhanh lên, mọi người đang cần sự giúp đỡ của bạn đấy\", \"Xong việc rồi, về báo cáo với ông Moori nào!\"]');
INSERT INTO `tasktemplate` VALUES (6, 'Nhiệm vụ', 'Khủng long mẹ sống tại Trái Đất\r\nLợn lòi mẹ sống tại Namếc\r\nQuỷ đất mẹ sống tại Xayda\r\nDùng tàu vũ trụ để di chuyển sang hành tinh khác\r\nThưởng 4 k sức mạnh\r\nThưởng 4 k tiềm năng', '[\"Đánh 3 con khủng long mẹ\", \"Đánh 3 con quỷ đất mẹ\",\"Đánh 3 con lợn lòi mẹ\", \"Báo cáo với ông Paragus\"]', '[3, 3, 3, -1]', '[\"Bạn vừa nhận được bản đồ của hành tinh tiếp theo\", \"#Tốt lắm, bây giờ hãy đến hành tinh tiếp theo nào\\nĐể di chuyển đến hành tinh khác, bạn hãy đến Trạm Phi Thuyền, gặp Cui\\nNhanh lên, mọi người đang cần sự giúp đỡ của bạn đấy\", \"Mau đến hành tinh tiếp theo nào. Nhanh lên, mọi người đang cần sự giúp đỡ của bạn đấy\", \"Xong việc rồi, về báo cáo với ông Paragus nào!\"]');
INSERT INTO `tasktemplate` VALUES (7, 'Nhiệm vụ giải cứu Dende', 'Tìm đường đến Thung lũng Maima, hạ 20 con phi long\nThưởng 8 k sức mạnh\nThưởng 8 k tiềm năng', '[\"Đạt 16.000 sức mạnh\", \"Đánh bại 20 con phi long\", \"Nói chuyện với Dende\", \"Báo cáo với ông Moori\"]', '[1, 20, -1, -1]', '[\"\", \"Bạn đã đạt sức mạnh yêu cầu, đi làm nhiệm vụ nào\", \"Bạn vừa cứu được Dende hãy về Làng Moori và nói chuyện với Dende\", \"Xong việc rồi, về báo cáo với ông Moori nào!\"]');
INSERT INTO `tasktemplate` VALUES (8, 'Nhiệm vụ tìm ngọc', 'Ngọc rồng 7 sao đang bị bọn thằn lằn mẹ cướp đi tại Rừng xương, Trái Đất. Đánh bại chúng để tìm lại.\nThưởng 15 k sức mạnh\nThưởng 15 k tiềm năng', '[\"Đạt 40.000 sức mạnh\", \"Tìm viên ngọc rồng 7 sao\", \"Đem ngọc về cho ông Paragus\", \"Tìm tháp Karin\"]', '[-1, -1, -1, -1]', '[\"\", \"Bạn đã đạt sức mạnh yêu cầu, đi làm nhiệm vụ nào\", \"Tìm thấy viên ngọc rồng 7 sao rồi, đem về cho ông Paragus nào!\", \"\"]');
INSERT INTO `tasktemplate` VALUES (9, 'Chạm trán tàu 77', 'chưa có mô tả', '[\"Nói chuyện với Bò Mộng\",\"Đụng độ tàu 77\",\"Bỏ chạy lên tháp karin\",\"Nói chuyện với thần mèo\"]', '[-1,-1,-1,-1]', '[\"\",\"Hình như có người đang tới đây\",\"Đây có phải tên tàu 77 mà Bò Mộng đang nhắc tới ?, hãy thử sức xem sao\",\"hãy đến nói chuyện với thần mèo karin\"]');
INSERT INTO `tasktemplate` VALUES (10, ' Nhiệm vụ tìm ngọc', 'Học võ với Thần Mèo\nXuống rừng Karin tiêu diệt Tàu Pảy Pảy\nđem ngọc về cho ông Paragus\nThưởng 15 k sức mạnh\nThưởng 15 k tiềm năng', '[\"Đánh thắng Thần Mèo\", \"Tiêu diệt Tàu Pảy Pảy\", \"Nói chuyện với Bò Mộng\", \"Báo cáo với ông Paragus\"]', '[-1, -1, -1, -1]', '[\"#Để luyện tập, hãy đến gặp thần mèo Karin, chọn mục Luyện tập\\nBạn cũng có thể luyện tập khi đang offline bằng cách thoát game sau khi chọn mục Luyện tập\r\nKhi đủ khả năng ,hãy chọn mục thách đấu, nếu chiến thắng bạn có thể luyện tập với các đối thủ khác mạnh hơn\\nNgoài ra bạn cũng có thể tặng ngọc để chiến thắng\\nLuyện tập sẽ giúp tăng tiềm năng và sức mạnh, đối thủ càng mạnh sẽ tăng càng nhanh\", \"Đã đến lúc tiêu diệt Tàu Pảy Pảy\", \"Tàu Pảy Pảy đã bị tiêu diệt, hãy đến nói chuyện với Bò Mộng\", \"Viên ngọc rồng 6 sao đây rồi, đem về cho ông Paragus nào!\"]\r\n ');
INSERT INTO `tasktemplate` VALUES (11, ' Nhiệm vụ bái sư ', 'Tìm Vua Vegeta tại Vách núi đen bái sư học võ\nThưởng 5 k sức mạnh\nThưởng 5 k tiềm năng', '[\"Tìm Vua Vegeta tại Vách núi đen\", \"Tặng ngài cuốn truyện Đôrêmon\"]', '[-1, -1]\n', '[\"\",\"\" ]');
INSERT INTO `tasktemplate` VALUES (12, 'Nhiệm vụ gia nhập bang hội', 'Báo cáo với Vua Vegeta khi bang của bạn có từ 5 thành viên trở lên\nThưởng 20 k sức mạnh\nThưởng 20 k tiềm năng ', '[\"Vào 1 bang hội\", \"Báo cáo với Vua Vegeta\"]', '[-1, -1]', '[\"\",\"\" ]');
INSERT INTO `tasktemplate` VALUES (13, ' Nhiệm vụ bang hội đầu tiên ', 'Cùng ít nhất 2 thành viên trong bang tiêu diệt\nHeo rừng tại Rừng dương xỉ (Trái đất)\nHeo da xanh tại Núi hoa tím (Namếc)\nHeo Xayda tại Rừng đá (Xayda)\nThưởng 50 k sức mạnh\nThưởng 50 k tiềm năng', '[\"Tiêu diệt Heo rừng\", \"Tiêu diệt Heo da xanh\", \"Tiêu diệt Heo Xayda\", \"Báo cáo với Vua Vegeta\"]', '[30, 30, 30, -1]\n', '[\"Heo rừng tại Rừng dương xỉ\", \"Heo da xanh tại Núi hoa tím\",\" Heo Xayda tại Rừng đá\", \"Nhiệm vụ hoàn thành, báo cáo với Vua Vegeta nào!\"]');
INSERT INTO `tasktemplate` VALUES (18, ' Nhiệm vụ đánh trùm ', 'Đạt 1.500.000 sức mạnh để trở thành Siêu Namếc\nTiêu diệt Drum tại Thung lũng Namếc, tiêu diệt Tambourine tại Đông Karin, tiêu diệt Akkuman tại Thành phố Vegeta\nThưởng 200 k sức mạnh\nThưởng 200 k tiềm năng ', '[\"Đạt 1.500.000 sức mạnh\", \"Tiêu diệt Drum\",\" Tiêu diệt Tambourine\", \"Tiêu diệt Akkuman\", \"Báo cáo với Trưởng lão Guru\"]', '[-1, -1, -1, -1, -1]', ' [\"\",\"Chúc mừng bạn đã trở thành Siêu Namếc\" , \"Mau đến Trái Đất đánh bại Tambourine tại Đông Karin\", \"Đến Xayda đánh bại Akkuman tại Thành phố Vegeta\", \"Báo cáo với Trưởng lão Guru nào!\"]');
INSERT INTO `tasktemplate` VALUES (20, ' Nhiệm vụ thử thách', 'Đạt 5 triệu sức mạnh\nTham gia và chiến thắng vòng 2 đại hội võ thuật tại Vách núi Kakarot\nThưởng 500 k sức mạnh\nThưởng 500 k tiềm năng ', '[\"Đạt 5.000.000 sức mạnh\",\" Thắng vòng 2 đại hội võ thuật\",\" Báo cáo với Trưởng lão Guru\"]', '[-1, -1, -1]', '[\"Chúc mừng bạn đã đạt 5 triệu sức mạnh\",\" Hãy tham gia đại hội võ thuật và chiến thắng vòng 2 nhé\",\" Chúc mừng bạn đã thắng vòng 2, hãy báo cáo với Trưởng lão Guru nào!\"]');
INSERT INTO `tasktemplate` VALUES (22, 'Nhiệm vụ bất khả thi ', ' Đạt 50 triệu sức mạnh\nTiêu diệt bọn tay sai của Fide tại Xayda\nThưởng 50 Tr sức mạnh', '[\"Đạt 50 triệu sức mạnh\", \"Tiêu diệt Nappa\", \"Tiêu diệt Soldier\", \"Tiêu diệt Appule\", \"Tiêu diệt Raspberry\", \"Tiêu diệt Thằn lằn xanh\", \"Báo cáo với Trưởng lão Guru\"\n]', ' [-1, 500, 400, 300, 200, 100, -1]\n', '[\"Chúc mừng bạn đã đạt 50 triệu sức mạnh\", \"Hãy lên đường ngăn chặn bọn Fide nào\", \"Tiếp tục bọn chúng vẫn còn đông lắm\", \"Tiếp tục bọn chúng vẫn còn đông lắm\", \"Tiếp tục bọn chúng vẫn còn đông lắm\", \"Tiếp tục bọn chúng vẫn còn đông lắm\", \"Chúc mừng bạn, bọn lính Fide đã bị tiêu diệt, hãy báo cáo với Trưởng lão Guru nào!\"]');
